window.bookSummaryJSON = "<p>Finding out you’re the daughter of a millionaire true crime novelist isn’t all it’s cracked up to be.</p> <p>When I was two, I was kidnapped. Kidnapped by a loving family, sure, but still kidnapped.</p> <p>Now, my biological mom wants me to live with her on the opposite side of the country.</p> <p>Her…and my new stepdad and his jerk of a son: Parrish.</p> <p>Wannabe tattoo artist, languorous rich boy, pouty mouth.</p> <p>Starting a new life on the West Coast sucks, especially when there’s no love lost between me and my new family.</p> <p>Oh, and my biological father? Did I mention that he’s a serial killer who wants me to play his games?</p> <p>Find the right clues, follow the right trail, or someone I love gets hurt.</p> <p>But what if he’s just kidnapped someone I hate instead?</p> <p>Parrish Vanguard is a royal asshole.</p> <p>The question is: Does he deserve to die?</p> <p>With the help of Parrish’s best friends—Maxx and Chasm—I have to risk everything to save a boy who considers himself my sworn enemy. Even if I save his ass, he’ll never thank me.</p> <p>Lucky for him that our love-hate relationship isn’t a deal breaker.</p> <p>I’ll play, Dad.</p> <p>Start the game.</p> <p><i>Stolen Crush</i> is a 180,000 word love-hate/high school romance with suspense/thriller themes. This is book one of three in the series.</p>"; 
